import React, { Component } from "react";
class Header extends Component {
    constructor(props) {
        super(props);
        this.state = { searchKey: '' }
    }
    getKeySearch = (e) => {
        this.setState(
            {
                searchKey: e.target.value
            }
        );
    }
    search = () => {
        this.props.changgeProduct (this.state.searchKey)
    }
    render() {

        return (
            <div className="header">
                <div className="header-header">
                    <img className="" alt="Logo" src="./image/Logo.png"></img>
                </div>
                <div className="search">
                    <input className="btn_search" type="submit" value="Search" onClick={this.search} />
                    <input className="key_search" type="text" value={this.state.searchKey} onChange={this.getKeySearch} />
                </div>
            </div>

        )
    }
}
export default Header;
